package claire.util.crypto.hash.primitive.WMD;

import claire.util.encoding.Hex;
import claire.util.memory.Bits;

public class WMD_SBOX {
	
	/*
	 * If dumb you think this is, right you are.
	 */
	
	private static String s1() { return ""; }
	private static String s2() { return ""; }
	private static String s3() { return ""; }
	private static String s4() { return ""; }
	private static String s5() { return ""; }
	private static String s6() { return ""; }
	private static String s7() { return ""; }
	private static String s8() { return ""; }

	public static final void init(short[] shorts)
	{
		byte[] buf = new byte[16384];
		Hex.fromHex(s1(), 0, buf, 0);
		Bits.bytesToShorts(buf, 0, shorts, 0, 8192);
		Hex.fromHex(s2(), 0, buf, 0);
		Bits.bytesToShorts(buf, 0, shorts, 8192, 8192);
		Hex.fromHex(s3(), 0, buf, 0);
		Bits.bytesToShorts(buf, 0, shorts, 8192 * 2, 8192);
		Hex.fromHex(s4(), 0, buf, 0);
		Bits.bytesToShorts(buf, 0, shorts, 8192 * 3, 8192);
		Hex.fromHex(s5(), 0, buf, 0);
		Bits.bytesToShorts(buf, 0, shorts, 8192 * 4, 8192);
		Hex.fromHex(s6(), 0, buf, 0);
		Bits.bytesToShorts(buf, 0, shorts, 8192 * 5, 8192);
		Hex.fromHex(s7(), 0, buf, 0);
		Bits.bytesToShorts(buf, 0, shorts, 8192 * 6, 8192);
		Hex.fromHex(s8(), 0, buf, 0);
		Bits.bytesToShorts(buf, 0, shorts, 8192 * 7, 8192);
	}
	
}
